import { Container, Typography } from "@mui/material";
import React from "react";
const DataHolder = () => {
  return (
    <React.Fragment>
      <Typography variant="h3" color="primary" component="h3">
        Todo DataHolder
      </Typography>
    </React.Fragment>
  );
};

export default DataHolder;
